// import { combineReducers } from "redux";

// export default combineReducers({});

import InitialState from "../initialState";

export default function reducer(state = InitialState, action) {
  switch (action.type) {
    case "toggleGamePlay":
      return { ...state, game: !state.game };
    case "toggleBarReady":
      return { ...state, barReady: !state.barReady };
    case "ChangeYVel":
      return { ...state, ballyv: state.ballyv * action.payload };
    case "ChangeXVel":
      return { ...state, ballxv: state.ballxv * action.payload };
    case "ChangeCoords":
      return { ...state, ballx: action.payload.x };
    default:
      return state;
  }
}
